import { Constants, inputDataDelivery } from "../styles/Constants";
import { SerifTextS } from "../styles/TextStyles";

export const HistoryFormData = (data: any) => {
  return (
    <div style={{ display: "grid", gridTemplateColumns: "40% 50%" }}>
      {inputDataDelivery.data.map((item) => (
        <div
          style={{
            display: "flex",
            flexDirection: "column",
          }}
        >
          <SerifTextS style={{ textAlign: "left" }}>
            {Constants.forms[item.value as keyof { deliveryTime: any }]}
          </SerifTextS>
          <SerifTextS style={{ textAlign: "left" }}>
            {data[item.value as keyof any]}
          </SerifTextS>
        </div>
      ))}
    </div>
  );
};
